  render: () => {
    const [open, setOpen] = useState(true);
    const handleClick = () => {
      setOpen(!open);
    };
    return <List sx={{
      width: '100%',
      maxWidth: 360,
      bgcolor: 'background.paper'
    }} component="nav" aria-labelledby="nested-list-subheader" dense subheader={<ListSubheader component="div" id="nested-list-subheader">
            Nested List Items
          </ListSubheader>}>
        <ListItemButton>
          <ListItemIcon>
            <FolderIcon />
          </ListItemIcon>
          <ListItemText primary="Sent mail" />
        </ListItemButton>
        <ListItemButton>
          <ListItemIcon>
            <FolderIcon />
          </ListItemIcon>
          <ListItemText primary="Drafts" />
        </ListItemButton>
        <ListItemButton onClick={handleClick}>
          <ListItemIcon>
            <FolderIcon />
          </ListItemIcon>
          <ListItemText primary="Inbox" />
          {open ? <TriangleCollapseIcon /> : <TriangleExpandIcon />}
        </ListItemButton>
        <Collapse in={open} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <ListItemButton sx={{
            pl: 4
          }}>
              <ListItemIcon>
                <FolderTreeIcon />
              </ListItemIcon>
              <ListItemText primary="Starred" />
            </ListItemButton>
          </List>
        </Collapse>
      </List>;
  }
